import { Page, Text, View, Document, StyleSheet } from '@react-pdf/renderer';



export default function Resume(props) {


  const test = [{'key':1, "Task":"Coding","Hours":2,"Rate":72},
                {'key':2,"Task":"Testing","Hours":2,"Rate":72},
                {'key':3,"Task":"Meeting","Hours":2,"Rate":72},
                {'key':4,"Task":"Deployment","Hours":2,"Rate":72},
                {'key':5,"Task":"UAT","Hours":2,"Rate":72}]

  const test2 = props.text
  console.log(test2)
  console.log(test)

  const styles = StyleSheet.create({
    page: {

    },
    section: {
      border: '3px solid green',
      padding: '10px',
      height:'20%'
    },
  });

  return (
    <Document>
      <Page size="A1" style={styles.page}>
          {test2.map(item => (
            <View style={styles.section}>
            <Text>
                {item.input1}{'\n\n'}
          </Text>
          </View>
        ))}
    </Page>
  </Document>
);
}
